import React from 'react';
import s from './Header.module.css'
import ProfilePicture from "../Profile/ProfilePicture/ProfilePicture";



const Header = () => {
    return (
        <header className={s.header}>

            <img src='data:image/png;base64,' />
        </header>
    );

};

export default Header;
